window.bookSummaryJSON = "<p><b>From the author of the</b><b><i> New York Times</i></b><b> bestselling King’s Dark Tidings series comes a prequel novel set in that world.</b></p> <p>Wesson is still years from becoming a man when an immense darkness stirs within his core. The sinister power bursts free during a confrontation with an old enemy, and Wesson’s tranquil life is left in tatters.</p> <p>Forced to flee a murderous mob, Wesson stumbles onto a tumultuous path where he must confront the destructive power he has awakened. He must learn control over the power he wields or risk being consumed by it. As he wrestles with his training, an assassin stalks his every move. This new enemy is sent by a mysterious foe, one who will force Wesson to choose between the kindness in his heart and the seductive power in his soul.</p> <p><i>Mage of No Renown</i> can be enjoyed as a standalone, but be warned: it will likely lead you into<i> Free The Darkness.</i></p>"; 
